import React from "react";

const coreModules = ['hello', 'world'];





export class Table extends React.Component {
    constructor(props) {
        super(props);
        this.makeTable = this.makeTable.bind(this);
    }

    makeTable() {
       return coreModules.map((module) => 
            (<tr>
                <td>{module}</td>
            </tr>))
    }


    render() {
        return (
            <div>
                <h3>Core Modules</h3>
                <table>{this.makeTable}</table>
            </div>
        )

    }
}
